    n = len(S)
    a = S.count('A')
    b = S.count('B')
    c = 1
    if a > 2 and b == 0 or (b > 2 and a == 0):
        return -1
    elif a == 2:
        return 'A'
    elif b == 2:
        return 'B'
    elif n > 3:
        for i in range(n - 3):
            if i == 0 and (S[:3] == 'AAB' or S[:4] == 'BBA'):
                return S[1:]
                c = 1
                break
            else:
                p = S[i:i + 4]
                if p == 'ABBA' or p == 'BAAB':
                    return S[:i + 1] + S[i + 2:]
                    c = 1
                    break
        if c == 0 and (S[n - 3:] == 'ABB' or S[n - 3:] == 'BAA'):
            return S[:n - 1]
            c = 1
    return -1 if c == 0 else ''

